import { Injectable } from '@angular/core';
import { HttpClient, HttpHeaders } from '@angular/common/http';
import { GraphRequest } from './types/graph_request';
import { catchError, map, tap } from 'rxjs/operators';
import { Observable } from 'rxjs/internal/Observable';
import { of } from 'rxjs/internal/observable/of';

@Injectable({
  providedIn: 'root'
})
export class SvgServiceService {

  constructor(
    private http: HttpClient) { }

    private backend_URI = "http://localhost:8000"

    post(graphRequest:GraphRequest): Observable<String[]>{
      const resp = this.http.post<String[]>(this.backend_URI+"/clingviz/",graphRequest)
      .pipe(
        catchError((error,caught) => {
          // Handle the error here (e.g., log it or throw a custom error)
          console.error('Error occurred during the HTTP request:', error);
          return caught
        })
      );
      return resp; 
    } 
}
